import React from "react";
function Student(props){
    return(
        <>
        <div style={{textAlign:"center", background:"pink", width:"100%",padding:"0.5rem"}}>
            <h1>Hello {props.name}</h1>
            <h3>Email: {props.email}</h3>
            </div>
        </>
    )
}

export default Student;
